import React from "react";


class Hello extends React.Component {
  render(props) {
    return (
      <div className="tc pv4 pv5-ns">
        <img src="public/lightbulb.jpg" className="br-100 pa1 ba b--black-10 h3 w3" alt="avatar" />
        <h1 className="f5 f4-ns fw6 mid-gray">{this.props.title}</h1>
        <h2 className="f6 gray fw2 ttu tracked">{this.props.text}</h2>
      </div>
    )
  }
}

export default Hello;
